import * as React from 'react';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import { Container, Typography } from '@mui/material';
import ClipLoader from "react-spinners/ClipLoader";

export default class ImageWindow extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            images: props.image
        }
        console.log(this.state.images)
    }
    render(){
        if (this.state.images == 0){
            return(
                <Container maxWidth='lg' fixed>
                    <Box 
                        width={'100%'}
                        height={450}
                        display="flex" 
                        alignItems="center"
                        justifyContent="center"
                        sx={{backgroundColor: 'secondary.main',
                            borderRadius: 5,
                            border: 2,
                            borderStyle: 'dashed'
                        }}>
                        <Typography>output image preview will be shown here after uploading.</Typography>
                        <ClipLoader color={color} loading={loading} css={override} size={150} />
                        
                    </Box>
                </Container>
            )
        }
        else{
            return(
                <Grid container spacing={2}>
                    <Grid item xs={6}>
                        <Box sx={{width: 475, height: 400, backgroundColor: 'secondary.main' }} position='relative'>
                        </Box>
                    </Grid>
                    <Grid item xs={6}>
                        <Box sx={{width: 475, height: 400, backgroundColor: 'secondary.main'}} position='relative'></Box>
                    </Grid>
                </Grid>
            )
        }
    }
}
